    "2016-02-26T22:02:18.144006",nt"name": "hirenasd-fem-wing-only-hex20",nt"isopen":
    true,nt"url": null,nt"notes": "The finite element model being used by the
    AePW is based on the model provided at rn[**HIRENASD website**](https://heinrich.lufmech.rwth-aachen.de/index.php?lang=en&pg=home)rnrnThe
    NASTRAN FEM's using HEXA solid elements and identified as "structured"(str) is
    the one that will be used.  Another exists which uses TETRA elements and is labeled
    "unstructured"(unstr).  The original FEM's as provided on the website had different
    coordinate systems and are in different units. rn<LI> str = mm rn<LI> unstructured
    = metersrnrnThe coordinate systems for each of the FEM are different also.  To facilitate
    use both FEM's were modified so that the x direction is in the flow direction, y
    - is out the wing and z is goes from lower surface to upper surface of the wing
    and the models are in meters. rnrnMode shapes and frequencies were calculated with
    both FEM's and a frequency comparison is provided.  The only model NASA has used
    is the "str" model.   rnrnComparisons of the FEM as provided from HIRENASD website
    with as modified are <a href="https://c3.ndc.nasa.gov/dashlink/static/media/dataset/HIRENASD_coordinate_system_2.pdf">provided</a>rnrn<TABLE>rn<TR><TD>rn<img
    src="https://c3.ndc.nasa.gov/dashlink/static/media/other/CoordinateSystem_StructuredFEM.jpg">rn</TD></TR>rn<TR><TD>rn<img
    src="https://c3.ndc.nasa.gov/dashlink/static/media/other/CoordinateSystem_UnstructuredFEM.jpg">rn</TD></TR></TABLE>rnrn",nt"license_title":
